import {BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./Home"
import Navbar from "./Navbar";
import CountryDetails from "./CountryDetails";

function App() {

  return(
    <Router>
      <Navbar />
      <main>
        <Routes>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/:name">
            <CountryDetails />
          </Route>
        </Routes>
      </main>
    </Router>
  )

}

export default App;
